import Upload from './components/Upload';
import Navbar from './components/Navbar';
import Wallpapers from './components/Wallpapers';
import {
  createBrowserRouter,
  Outlet,
  RouterProvider,
} from "react-router-dom";


const Layout=()=>{
  return(
    <>
    <Navbar/>
    <Outlet/>

    </>
  )
}

const router = createBrowserRouter([
  {
    path: "/",
    element: <Layout/>,
    children:[
      {
        path: "/",
        element:<Wallpapers/>

      },
      {
        path: "/upload",
        element:<Upload/>
      }
    ]
  },
]);



function App() {
  return (
    <div className='w-9/12 bg' >
      <div>

      <RouterProvider router={router} />

      </div>


    </div>
  );
}

export default App;
